    if (format === "png") {
      context.drawImage(img, 0, 0, w, h, 0, 0, w * pngZoom, h * pngZoom);
      url = canvas.node().toDataURL("image/png");
    }

    const a = select("body").append("a");
    a.attr("class", "downloadLink")
      .attr("download", filename)
      .attr("href", url)
      .text("test")
      .style("display", "none");

    a.node().click();

