function filenameWithTimestamp(prefix) {
  return prefix + "-" + format(new Date(), "yyyyMMdd-HHmmss");
}

function downloadSvgMenuItem(stanza, filenamePrefix) {
  return {
    type: "item",
    label: "Download SVG",
    handler: () => {
      downloadImg(
        stanza.root.querySelector("svg"),
        "svg",
        filenameWithTimestamp(filenamePrefix),
        stanza.root
      );
    },
  };
}

function downloadPngMenuItem(stanza, filenamePrefix) {
  return {
    type: "item",
    label: "Download PNG",
    handler: () => {
      downloadImg(
        stanza.root.querySelector("svg"),
        "png",
        filenameWithTimestamp(filenamePrefix),
        stanza.root
      );
    },
  };
}

const downloadBlob = (blob, fileName) => {
  const link = document.createElement("a");
  link.download = fileName;
  link.href = URL.createObjectURL(blob);
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
  URL.revokeObjectURL(link.href);
};

function downloadJSONMenuItem(stanza, filenamePrefix, data) {
  return {
    type: "item",
    label: "Download JSON",
    handler: () => {
      const blob = new Blob([JSON.stringify(data, null, "  ")], {
        type: "application/json",
      });
      downloadBlob(blob, filenameWithTimestamp(filenamePrefix) + ".json");
    },
  };
}

function downloadCSVMenuItem(stanza, filenamePrefix, data) {
  return {
    type: "item",
    label: "Download CSV",
    handler: () => {
      const csv = stringify(data, { header: true, bom: true });
      const blob = new Blob([csv], { type: "text/csv" });
      downloadBlob(blob, filenameWithTimestamp(filenamePrefix) + ".csv");
    },
  };
}

function downloadTSVMenuItem(stanza, filenamePrefix, data) {
  return {
    type: "item",
    label: "Download TSV",
    handler: () => {
      const tsv = stringify(data, {
        header: true,
        bom: true,
        delimiter: "\t",
      });
      const blob = new Blob([tsv], { type: "text/tsv" });
      downloadBlob(blob, filenameWithTimestamp(filenamePrefix) + ".tsv");
    },
  };
}

function copyHTMLSnippetToClipboardMenuItem(stanza) {
  return {
    type: "item",
    label: "Copy HTML snippet to clipboard",
    handler: async () => {
      const script = document.createElement("script");
      script.type = "module";
      script.src = stanza.url;
      const html = [script.outerHTML, stanza.element.outerHTML].join(" ");

      await navigator.clipboard.writeText(html);
    },
  };
}

function appendCustomCss(stanza, customCssUrl) {
  const links = stanza.root.querySelectorAll(
    "link[data-togostanza-custom-css]"
  );
  for (const link of links) {
    link.remove();
  }

  if (customCssUrl) {
    const link = document.createElement("link");
    stanza.root.appendChild(link);

    link.setAttribute("rel", "stylesheet");
    link.setAttribute("href", customCssUrl);
    link.setAttribute("data-togostanza-custom-css", "");
  }
}

